import React from 'react';
import { Text, View } from 'react-native';

const Gato = (props) => {
  return (
    <View>
      <Text>Hola, soy {props.name}!</Text>
    </View>
  );
}

const Felino = () => {
  return (
   <View>
      <Text>Presentacion!</Text>
   </View>
  )
}

export default Felino;
